import React from "react";

// react-bootstrap components
import {
  Container,
  Row,
  Col,
} from "react-bootstrap";

function Typography() {
  return (
    <>
      <Container fluid>
        <Row>
          <Col md="12">

          </Col>
        </Row>
      </Container>
    </>
  );
}

export default Typography;
